function Navbar() {
  return (
    <div>
      <a href="#">Markata</a>
      <a href="#"> Home</a>
      <a href="#"> Contact</a>
      <a href="#"> About</a>
      <a href="#"> Sign Up</a>
      <div>
        <input />
      </div>
    </div>
  );
}

export default Navbar;
